import Input from "../../../../../common/components/input/Input";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMagnifyingGlass } from "@fortawesome/free-solid-svg-icons";

import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import React from "react";
import { RightFilters } from "../../../../../common/components/RightFilters/RightFilters";
export const Projects = () => {
  return (
    <>
      <ProjectsFilter />
    </>
  );
};
export const ProjectsFilter = () => {
  return (
    <>
      <div className=" mb-4">
        <div className="row g-3">
          <div className="col-xxl-10 col-xl-10 col-lg-10 col-md-10 col-sm-10 col-10  d-flex">
            <div className="ApprovalDetailsPage_date_picker">
              <div className="ApprovalDetailsPage_search_input_iner_div">
                <span>
                  <FontAwesomeIcon icon={faMagnifyingGlass} />
                </span>
                <Input
                  type="text"
                  className="form-control"
                  placeholder="Search"
                />
              </div>
            </div>
          </div>
          <div className="col-2">
            <RightFilters
              title="Filter"
              btn1="Reset"
              btn2="Show results"
              data={<ProjectsRightFiltersData />}
            />
          </div>
        </div>
      </div>
    </>
  );
};
export const ProjectsRightFiltersData = () => {
  return (
    <>
      <div className="row">
        <div className="col-6">
          <FormGroup>
            <FormControlLabel control={<Checkbox />} label="Most recent" />
          </FormGroup>
        </div>
        <div className="col-6">
          <FormGroup>
            <FormControlLabel control={<Checkbox />} label="Most recent" />
          </FormGroup>
        </div>
      </div>
    </>
  );
};
